import React from "react";
import Typography from '@material-ui/core/Typography';


export default function PostData({ postData, setPostData, setPostId }) {
  const backTofeed = () => {
    setPostId(0);
    setPostData([]);
  };

  return (
    <div>
      <h1>{postData.title}</h1>

    </div>
  );
}
